import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Entry from './page/entry/Entry.page';
import DefaultLayout from './layout/DefaultLayout';
import Dashboard from './page/dashboard/Dashboard.page';
import AddTicket from './page/new-ticket/AddTicket.page';
import TicketLists from './page/ticket-list/TicketLists.page';
import Ticket from './page/ticket/Ticket.page';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          {/* Public Route */}
          <Route path="/" element={<Entry />} />

          {/* Protected Routes wrapped inside DefaultLayout */}
          <Route path="/" element={<DefaultLayout />}>
            <P path="dashboard" element={<Dashboard />} />
      P path="add-ticket" element={<AddTicket />} />
            <P path="tickets" element={<TicketLists />} />
            <P path="ticket/:tid" element={<Ticket />} />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
